import React from 'react';
import styled from 'styled-components';

function UserPopup() {
	return <ComponentWrapper>pop</ComponentWrapper>;
}

const ComponentWrapper = styled.div`
	height: 100%;
	width: 500px;
	font-size: 14px;
	color: #333;
	font-weight: 600;
	line-height: 1;
	position: absolute;
	top: 100%;
	right: -27px;
	margin-top: 13px;
	padding: 0 !important;
	display: block;
	transform: translate(50%, 8px);

	border: 1px solid black;
`;

export default UserPopup;
